svg.script:
    document.addEventListener("DOMContentLoaded", function() { 
    let paths = document.querySelectorAll("path");
        for(let i = 0; i < paths.length; i++){
            let time = i * 5;
            setTimeout(function(){
                let path = paths[i];
                
                // Calculate random horizontal offset
                //let randomOffset = (Math.random() - 0.5) * 100;  // Adjust multiplier for a wider range

                path.style.opacity = 1;
                
                // First move to slightly beyond their final position
                //path.style.transform = `translate(${randomOffset}px, 20px)`; // Adjust the Y offset as per requirement
                path.style.transform = `translate(0px, 2000px)`; // Adjust the Y offset as per requirement

                // After a short delay, snap back to their final position
                setTimeout(function(){
                    path.style.transform = `translate(0px, 0px)`;
                    path.style.opacity = 1; 
                    
                }, 250);  // 250ms delay, adjust as needed

            }, time);
        }
    });
